   <div>
<select onChange={(e)=>handleCatChange(e.target.value)} className="form-select"  >
  <option value ="all">select category</option>
  {category.map((el,i) => (
  <option key ={i} value={el.id}>{el.CategoryName}</option>
))}
</select>
    </div>
  )
}

export default Category
